import React, {useState} from 'react'
import { useNavigate } from "react-router-dom";
import {Divider, Row, Col, Input, Button, Image} from 'antd';
import Add from '../img/icon-registration.png';

import { uploadFile } from 'react-s3';

window.Buffer = window.Buffer || require("buffer").Buffer;

const Profile = () => {
    const navigate = useNavigate();
    const config = {
        bucketName: "aimsbconnectbucket",
        Name: "test.png",
        region: "us-east-1",
        accessKeyId: "AKIA6HGPOTO2LVH67RO2",
        secretAccessKey: "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"
    }

    const [selectedFile, setSelectedFile] = useState(null);
    const [fileType, setFileType] = useState(".png")

    const selectFile = (data) => {
        console.log(data)
        
        setSelectedFile(data)
    }
    const uploadPic = async(file) => {
        try {
            uploadFile(file, config)    
        } catch (err) {
            console.log(err.message)
        }
        
    }
    return (
        <div className="home">
            <Divider>
            <Row gutter = {16}>
            <Col span={8}>
            <Image src="https://aimsbconnectbucket.s3.amazonaws.com/tanjiro.png"/>
            </Col>
            <Col span={8}>
            <input type="file" name="test.png" style={{display:'Upload'}} onChange={(e) =>{selectFile(e.target.files[0])}} multiple />
            <button onClick={() => {uploadPic(selectedFile)}}>Upload</button>
            </Col>
            </Row>
            <Row gutter={16}>
                <Col span={8}/>
                <Col>
                    <Input />
                </Col>
                <Col span={8}/>
            </Row>
            <Row>
                <Col>
                    <Input />
                </Col>
            </Row>
            <Row>
                <Col>
                    <Input />
                </Col>
            </Row>
            </Divider>
            <Row>
                <Col>
                    <Button onClick={() => {navigate("/home")}}>Back</Button>
                </Col>
            </Row>
        </div>
    )
}

export default Profile;
